      date: new Date(2021, 2, 28)
    },
    {
      id: "e4",
      title: "New Desk (Wooden)",
      amount: 450,
      date: new Date(2021, 5, 12)
    }
  ];
  return (
    <div>
      <h1>Expense tracker! Let's get snazzy! ðŸ˜Ž</h1>
      <ExpenseType items={expenses} />
    </div>
  );
}

